sourcesContent:
import db from "../modules/index";
import CRUDservice from "../services/CRUDservice";

let getHomePage = async (req, res) => {
  try {
    let data = await db.User.findAll();
    return res.render("homePage.ejs", { data: JSON.stringify(data) });
  } catch (e) {
    console.log(e);
  }
};
let getAboutPage = (req, res) => {
  return res.send("hello world about");
};
let getCRUD = (req, res) => {
  return res.render("crud.ejs");
};
let postCRUD = async (req, res) => {
  console.log(req.body);
  const user = await CRUDservice.createNewUser(req.body);
  console.log(user);
  return res.send("Cng ha x hi ch ngha Vit Nam c lp t do hnh phc");
};
let displayGetCRUD = async (req, res) => {
  console.log("---------------------------");
  const data = await CRUDservice.getAllUser();
  console.log(data);
  console.log("--------------------------");
  return res.render("displayCRUD.ejs", { dataTable: data });
};
let getEditCRUD = (req, res) => {
  console.log(req.query.id);
  return res.send("Test return id");
};
module.exports = {
  getHomePage,
  getAboutPage,
  getCRUD,
  postCRUD,
  displayGetCRUD,
  getEditCRUD,
};

